import React from 'react';
import Logo from './img/logoStock.png';

export const StockFooter = () => {
  return (
    <footer className="bg-black py-6 relative text-white">
      {/* Círculo gris */}
      <div className="w-16 h-16 bg-gray-300 rounded-full absolute left-1/2 transform -translate-x-1/2"></div>

      <div className="container mx-auto flex items-center justify-between relative z-10">
        <div className="col-span-1 p-4">
          {/* Imagen superpuesta */}
          <div className="text-center relative z-20">
            <img
              src={Logo}
              alt="Logo"
              className="mx-auto h-16 relative z-20"
            />
          </div>
        </div>
        <div className="col-span-1 p-4">
          <div>
            <p>© 2023 StockMovil. Todos los derechos reservados.</p>
          </div>
        </div>
      </div>
    </footer>
  );
};
